import React from 'react';
import { View } from 'react-native';
import { ListItem, Text } from 'react-native-elements';

const ListOfLists = ({ navigation }) => {
  const lists = [
    {
      id: 123,
      title: 'Lista top',
      date: '05/04/2021',
      price: 353.44,
    },
    {
      id: 123,
      title: 'Lista supimpa',
      date: '05/04/2021',
      price: 353.44,
    },
  ];

  return (
    <View>
      {lists.map((list, index) => (
        <ListItem key={index} onPress={navigation.navigate('GroceryList')} bottomDivider>
          <ListItem.Content>
            <ListItem.Title>{list.title}</ListItem.Title>
            <ListItem.Subtitle>{list.date}</ListItem.Subtitle>
          </ListItem.Content>
          <Text>R$ {list.price}</Text>
          <ListItem.Chevron />
        </ListItem>
      ))}
    </View>
  );
};

export default ListOfLists;
